import { put, call, fork, take } from 'redux-saga/effects';
import * as actions from '../actions';
// import history from '../helper/history';

export function* LogIn(data) {
    console.log("submit------form");
    yield put(actions.LogIn.request());
    try {
        console.log(data, 'WWWWWWWWWWWWWWWWWWWWWWWWW')
        // if (!data.name || !data.roomno || !data.dob) {
        // throw new Error({ error: { customMessage: 'fields are mandatory.' } });
        // }
        // const response = yield call('http://localhost:3000/', data);
        // console.log("response---------->",response);
        // if (response.user.length > 0){
        //     yield put(actions.initialize({ IS_LOGIN: true }));
        //             yield put(actions.LogIn.success(response));
        //             yield call(history.push, '/dashboard');
        // }
        // else{
        //     yield put(actions.LogIn.failure({ customMessage:'Access Denied.'}));
        // }

    }
    catch ({ error }) {
        console.log(error)
        yield put(actions.LogIn.failure(error));
    }
}

export function* watchLogIn() {
    while (true) {
        const { payload } = yield take(actions.GUEST_LOG_IN);
        console.log(payload, 'ooooooooooooopppppppppppppppppppppppppppp')
        yield call(LogIn, payload);
    }
}


export default function* root(){
    yield all([fork(watchLogIn)])

}
